import React from 'react';

const Search = ({ search, setSearch }) => {
	return (
		<div>
			<input
				value={search}
				onChange={(e) => setSearch(e.target.value)}
				type='text'
				placeholder='Поиск'
			/>
		</div>
	);
};

export default Search;
